import React from 'react'
import Layout from './components/layout'
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Home from './pages/home';

export default function App() {

  return (
    <div className="App">
      <header className="App-header">
          <BrowserRouter>
            <Navbar/>
              <Routes>
                {/* Routes */}
                <Route exact path="/" element={<Home/>} />
                {/* Collection Services */}
                <Route exact path="/collection-services/house-hold/building-service" element={<BuildingService/>} />
                <Route exact path="/collection-services/house-hold/building-plus-service" element={<BuildingPlusService/>} />
                <Route exact path="/collection-services/on-demand/caps" element={<CAPS/>} />
                <Route exact path="/collection-services/on-demand/caps-lite" element={<CAPSLite/>} />
                <Route exact path="/collection-services/on-demand/caps-cdw" element={<CDW/>} />
                <Route exact path="/collection-services/commercial" element={<Commercial/>} />

                {/* Disposal Services */}
                <Route exact path="/disposal-services/waste-management-facilities" element={<WmFacilities/>} />
                <Route exact path="/disposal-services/transfer-station-facilities" element={<TsFacilities/>} />
                <Route exact path="/disposal-services/special-projects" element={<SpecialProjects/>} />
                <Route exact path="/disposal-services/expired-waste" element={<ExpiredWaste/>} />
                {/* Other Services */}
                <Route exact path="/other-services/docking-service" element={<Docking/>} />
                <Route exact path="/other-services/resale" element={<Resale/>} />
                <Route exact path="/other-services/vehicle-transfer-service" element={<VehicleTransfer/>} />

              </Routes>
            <Footer/>
          </BrowserRouter>
      </header>
    </div>

  )

}
